/// <summary>
/// Coinstructs an empty record.
/// </summary>
/// <param name = "_recordType">The string representing the type of the record.</param>
/// <returns>An instance of <c>FBSpedRecord_ADCR_BR</c> without any fields in it.</returns>
public static FBSpedRecord_ADCR_BR constructEmpty(str _recordType)
{
    return new FBSpedRecord_ADCR_BR(_recordType);
}

/// <summary>
/// Determines whether fields separators are needed at the beginning and end of records.
/// </summary>
/// <returns>Always false.</returns>
protected boolean needFramingRecordSeparators()
{
    return false;
}
